import React from "react";

function Home(props) {
  return (
    <div className=" w-full h-full">
      <div className="mainBanner block bg-red-500 w-full h-96 text-center">
        <h3 className="font-extrabold text-6xl -bottom-0">
          စစ်အာဏာရှင်စနစ် ကျဆုံးပါစေ
        </h3>
      </div>
    </div>
  );
}

export default Home;
